import React, { Component } from "react";

export default class ChatWindow extends Component {
  render() {
    const { chatDataA, chatDataB } = this.props;
    return (
      <div>
        <ul className="msglist">
          {chatDataA.map((itemA) => (
            <li style={{ color: "green" }}>{"Amy:  " + itemA}</li>
          ))}
          {chatDataB.map((itemB) => (
            <li style={{ color: "blue" }}>{"John:  " + itemB}</li>
          ))}
        </ul>
      </div>
    );
  }
}
